import React from 'react';
import Footer from './Footer';
import Map from './Map';

function App() {
  return (
      <Img src="./nasa.jpg">
          <React.Fragment>
              <Map/>
              <Footer/>
          </React.Fragment>
      </Img>
  );
}

export default App;
